import React from 'react';
import './Profile.css';

function Profile() {
  return (
    <div className="profile-page">
      <div className="profile-content">
        <div className="profile-header">
          <h1>Isabel Prado</h1>
          <p>Phoenix, Arizona</p>
        </div>
      </div>
    </div>
  );
}

export default Profile;
